style.css:
@-moz-document domain("onlinesequencer.net") {
*



/*------------WOOHOO LSD------------*/
#logo .icon {
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966865838479147028/output-onlinegiftools.gif);
    width: 70px;
    max-width: 60px;
    height: 60px;
    margin-right: 5px;
}
/*------------Main background, not really noticable on sequencer editor page------------*/
body {
    font-family:'PT Sans', sans-serif;
    font-size: 12px;
    text-align: left;
    margin: 0;
    background: url(https://media.discordapp.net/attachments/770244081338417154/966857355436367872/trippy.gif?width=400&height=420);
    min-width: 100px;
    min-height:100px;
    overflow-x: hidden !important;
}


#bottom {
    width: 100%;
    background-image: url(https://64.media.tumblr.com/671e0b4f553bf17a90f355106b1de9b9/tumblr_o3my3cbdyW1utwxd1o1_500.gifv);
    background-repeat: repeat-x;
    color: white;
    display: flex;
}

#header {
    height: 92px;
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966857355436367872/trippy.gif?width=400&height=420);
    position: relative;
}

#nav ul li:hover {
    background-color: rgba(0, 0, 0, 0.22);
}  
    #logo {
    align-items: center;
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966857355436367872/trippy.gif?width=400&height=420);
    color: white;
    text-decoration: none;
    justify-content: center;
    display: flex;
    padding: 15px;
}
#nav ul li:active, #nav ul li.active, #logo:active {
    background-color: rgba(0, 0, 0, 0.42);
}
 
/*------------this part changes some text------------*/

#logo .title {
  visibility: hidden;
}
#logo .title:before {
  content: 'LSD Sequencer';
  font-size: 22px;  
  visibility: visible;
}
#logo .subtitle {
  visibility: hidden;
}
#logo .subtitle:before {
  content: 'I shouldn’t have eaten those mushrooms...';
  font-size: 15px;  
  visibility: visible;
}
#chatbutton {
    visibility: hidden;
}
#chatbutton:before {
    display: block;
    position: absolute;
    bottom: 0;
    right: 0;
    width: 100px;
    height: 36px;
    background-color: #0D47A1;
    text-transform: none;
    visibility: visible;
    content: 'LSD';
}
   /*------------keyboard changer------------*/
.key_sharp {
    color: #ff00ea;
    background-color: #ff00ea;
    background: linear-gradient(to right, #71eb34, #4df0ff);
}
#sequencer {
    background-color: #35363a;
    flex: 1;
    display: flex;
    flex-direction: column;
    overflow: hidden;
    position: relative;
    -webkit-touch-callout: none;
    -webkit-user-select: none;
    -khtml-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
}

   /*------------TEXT COLOR CHANGER!------------*/

a {
    color: #fff;
    text-decoration: none;
    -webkit-tap-highlight-color: transparent;
}

.reply_text a {
    color: #fff;
}

/*------------forum theme handler------------*/

#os_logo .os_icon {
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966865838479147028/output-onlinegiftools.gif);
    width: 62px;
    min-width: 62px;
    height: 62px;
    margin-right: 5px;
}

#os_logo .os_title {
   visibility: hidden;
}
#os_logo .os_title:before {
    color: white;
    font-size: 22px;
    content: 'LSD Sequencer';
	visibility: visible;
}

#os_logo .os_subtitle {
   visibility: hidden;
}
#os_logo .os_subtitle:before {
    color: white;
    font-size: 22px;
    content: 'I shouldn’t have eaten those mushrooms...';
	visibility: visible;
}

#os_logo {
    align-items: center;
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966857355436367872/trippy.gif);
    color: white;
    text-decoration: none;
    justify-content: center;
    display: flex;
    padding: 15px;
}

#os_header {
    font-family: "Lucida Sans Unicode", "Lucida Grande", sans-serif;
    font-size: 12px;
    margin: 0;
    color: #eee;
    text-align: left;
    height: 92px;
    background-image: url(https://media.discordapp.net/attachments/770244081338417154/966857355436367872/trippy.gif);
    min-width: 1150px;
    position: relative;
}
 
#os_nav ul li:hover {
    background-color: rgba(0, 0, 0, 0.22);
}
}
